//     });
// }
    const Selection = []
    for (var j=0; j < SelectCoins.length; j++) {
      Selection.push(<p>{SelectCoins[j]["props"]["children"]}</p>)
    }
    console.log(Selection);


    // console.log(SelectCoins);
    // console.log(SelectCoins);

    return(
      <div class="dropdown">
      <ul>
      <li>
      {SelectCoins}
      </li>
      </ul>




      </div>
      )
  }
}

export default FinalPage
